import React from "react";

const Skills = () => {
  return (
    <section id="skills">
      <h2 className="skillsTitle">Skills</h2>
      <div className="skillContent">
        <h3></h3>
        <ul>
          <li></li>
        </ul>
      </div>
    </section>
  );
};

export default Skills;
